import React from 'react';

const TaskList = ({ tasks = [] }) => {
  return (
    <div>
      {tasks.length > 0 ? (
        tasks.map((task, index) => <div key={index}>{task.title}</div>)
      ) : (
        <p>No tasks available.</p>
      )}
    </div>
  );
};

export default TaskList;
